import React from 'react';
import unsplash from '../api/unsplash';
import Table from './Table';

class App extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            forms:[],
            // CreateForm:false
        };
      
    }
    componentDidMount=async()=>{
        const TableData=await unsplash.get('/getAll',{
        });

        var Schema=[];

        for(var i=0;i<TableData.data.length;i++)
        {
            Schema=(JSON.parse(TableData.data[i].formSchema));
            var  formObj={
                id:TableData.data[i].id,
                Schema:Schema
            }
            this.setState(prevState => ({
                forms: [...prevState.forms,formObj]
              }))
        }
    }
   
    nextPath=(path)=>{
        this.props.history.push(path);
    }
  
    render(){
        console.log(this.props);
        return(
            <div className="ui container" style={{marginTop:'10px'}}>
                <Table forms={this.state.forms}/>
                <button
                    style={{marginTop:"50px" }}
                    className="ui button"
                    onClick={()=>this.nextPath('/Wizard')}
                >
                 CreateForm
                </button>   
                {/* { this.state.CreateForm && <Wizard/> } */}
                {/* <Wizard GetForm={this.GetFormProperties}/> */}
            </div>
        );
    }

}


export default App;
